        var colorsR, tieUpR, harnessR, pedalsR, warpR, weftR, weaveR; // SVG groups' rectangles

        function drawTieUp () {
            let r = 0;
            for (let j = 0; j < harnessCount; j++) {
                for (let i = 0; i < pedalCount; i++) {
                    let color = (tieUp[i] & (1 << j)
                            ? "black"
                            : " white");
                    tieUpR[r++].setAttribute("fill", color);}}}

        function drawHarness () {
            let r = 0;
            for (let j = 0; j < harnessCount; j++) {
                for (let i = 0; i < harness.length; i++) {
                    let color = (harness[i] == j
                            ? "black"
                            : " white");
                    harnessR[r++].setAttribute("fill", color);}}}

        function drawPedals () {
            let r = 0;
            for (let j = 0; j < pedals.length; j++) {
                for (let i = 0; i < pedalCount; i++) {
                    let color = (pedals[j] == i
                            ? "black"
                            : " white");
                    pedalsR[r++].setAttribute("fill", color);}}}

        function randomColor (bias) {
            let nonWhiteColorCount = colorCount - 1;
            let gaussian = (Math.random() + Math.random() + Math.random() + Math.random() + Math.random()) / 5;
            let choice = Math.floor((bias + gaussian) * nonWhiteColorCount) % nonWhiteColorCount;
            let color = colorsR[choice].style.fill;
            return color;}

        function randomizeWarp () {
            for (let i = 0; i < harness.length; i++) {
                let color = randomColor(i / harness.length);
                warpR[i].setAttribute("fill", color);}}

        function randomizeWeft () {
            for (let j = 0; j < pedals.length; j++) {
                let color = randomColor(j / pedals.length);
                weftR[j].setAttribute("fill", color);}}

        function drawWarp () {
            for (let i = 0; i < harness.length; i++) {
                let choice = warp[i];
                let color = colorsR[choice].style.fill;
                warpR[i].setAttribute("fill", color);}}

        function drawWeft () {
            for (let j = 0; j < pedals.length; j++) {
                let choice = weft[j];
                let color = colorsR[choice].style.fill;
                weftR[j].setAttribute("fill", color);}}

        function drawWeave () {
            let r = 0;
            for (let j = 0; j < pedals.length; j++) {
                let p = pedals[j];
                let t = tieUp[p];
                for (let i = 0; i < harness.length; i++) {
                    let h = harness[i];
                    let isWarp = t & (1 << h);
                    let color = (isWarp
                            ? warpR[i].getAttribute("fill")
                            : weftR[j].getAttribute("fill"));
                    weaveR[r++].setAttribute("fill", color);}}}

        window.onload = init;

        function init () {
            svg = document.querySelector("svg");
            // pt = svg.createSVGPoint();
            let suspendID = svg.suspendRedraw(1000);
            colorsR = svg.getElementById("colors").children;
            tieUpR = svg.getElementById("tieup").children;
            harnessR = svg.getElementById("harness").children;
            pedalsR = svg.getElementById("pedals").children;
            warpR = svg.getElementById("warp").children;
            weftR = svg.getElementById("weft").children;
            weaveR = svg.getElementById("weave").children;
            drawTieUp();
            drawHarness();
            drawPedals();
            drawWarp();
            drawWeft();
            drawWeave();
            svg.unsuspendRedraw(suspendID);}

        // https://StackOverflow.com/questions/12752519/svg-capturing-mouse-coordinates
        // var pt;
        function BADxy(evt) {
            pt.x = evt.clientX;
            pt.y = evt.clientY;
            var cursorpt =  pt.matrixTransform(svg.getScreenCTM().inverse());
            console.log("(" + cursorpt.x + ", " + cursorpt.y + ")");
            return cursorpt;}

        var currentColor = 0; // black
        function colorZ (evt) {
            let x = evt.x;
            for (let c = 0; c < colorCount; c++) {
                var colorX = colorsR[c].getBoundingClientRect().x;
                if (x < colorX + colorSize) {
                    console.log(`color ${c}`);
                    currentColor = c;
                    return;}}
            alert("New thread colors not yet implemented.");}

        function warpZ (evt) {
            let x = evt.x;
            for (let i = 0; i < harness.length; i++) {
                var threadX = warpR[i].getBoundingClientRect().x;
                if (threadX < x) {
                    console.log(`warp thread ${i}`);
                    warpR[i].setAttribute("fill", colorsR[currentColor].style.fill);
                    drawWeave();
                    return;}}}

        function weftZ (evt) {
            let y = evt.y;
            for (let j = 0; j < pedals.length; j++) {
                var threadY = weftR[j].getBoundingClientRect().y;
                if (y < threadY + threadSize) {
                    console.log(`weft thread ${j}`);
                    weftR[j].setAttribute("fill", colorsR[currentColor].style.fill);
                    drawWeave();
                    return;}}}

        function pedalsZ (evt) {
            let x = evt.x;
            let y = evt.y;
            for (let j = 0; j < pedals.length; j++) {
                var threadY = pedalsR[pedalCount * j].getBoundingClientRect().y;
                if (y < threadY + threadSize) {
                    for (let i = 0; i < harness.length; i++) {
                        var threadX = pedalsR[i].getBoundingClientRect().x;
                        if (x < threadX + threadSize) {
                            console.log(`pedal ${i} ${j}`);
                            pedals[j] = i;
                            drawPedals();
                            drawWeave();
                            return;}}}}}
